import styled from "styled-components";

const MyPageComp = styled.div`
  width: 100%;
  height: 100vh;
  .mypage_inner {
    width: 80%;

    margin: 0 auto;

    display: flex;
    .side_menu {
      width: 300px;
      height: 500px;
      background-color: red;
    }
  }
`;
export default MyPageComp;
